import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import { AuthProvider } from './context/AuthContext'; // Importujemy Providera
import ProtectedRoute from './components/ProtectedRoute'; // Importujemy strażnika
import LoginPage from './pages/LoginPage';
import DashboardPage from './pages/DashboardPage';
import './App.css';

function App() {
  return (
    // Krok 1: Opakowujemy całą aplikację w AuthProvider
    <AuthProvider>
      <Router>
        <div className="App">
          <Routes>
            {/* Trasa publiczna - strona logowania */}
            <Route path="/" element={<LoginPage />} />

            {/* Trasy chronione */}
            <Route element={<ProtectedRoute />}>
              <Route path="/dashboard" element={<DashboardPage />} />
              {/* Tutaj możesz dodać inne chronione trasy, np. /profile, /settings */}
            </Route>
          </Routes>
        </div>
      </Router>
    </AuthProvider>
  );
}

export default App;
